                        "CONFLAGRATAM An 1677. Fabricatarn An 1698. Richardo Powell Armiger Thesaurar.\" The words, set in four panels, which formed a frieze beneath the pediment of a fine brick portico, summarized the history of one of the tall houses at the upper end of King's Bench Walk and as I, somewhat absently, read over the inscription, my attention was divided between admiration of the exquisitely finished carved brickwork and the quiet dignity of the building, and an effort to reconstitute the dead and gone Richard Powell, and the stirring times in which he played his part."
